	st7735s_write_command(0x29);
	st7735s_write_command(0x2C);

	// yay
	st7735s_set_window(0, 127, 0, 127);
	memset(st7735s_buffer, 0xFF, ST7735S_WIDTH * ST7735S_HEIGHT * 2);
	st7735s_flip();

